const fetchData=()=>{
        var something={};
        console.log('fetch data method is working');
        fetch('http://localhost:9000')
        .then(response => response.json())
        .then(data =>{something={...data} }).catch(error=>{console.log(error)
                });
       return something;
        }
export  {fetchData};
